import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import UncontrolledExample from './UncontrolledExample'; 

ReactDOM.render(
  <React.StrictMode>
    <UncontrolledExample />
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
